import React, { Component } from 'react';

import Header from '../components/Header'

class index extends Component {

  render() {
    return (
      <div>
        <Header/>
        <div class="bg-dark">
          <section className="container intro">
            <h1 class="display-4 pt-5 text-center text-info">
              The smart way to own your home
            </h1>
          </section>

          <div className="container">
              <div class="pt-5">
                <div className="d-flex flex-column mt-5  bg-warning">
                  <div className="d-flex justify-content-center align-items-center circle my-3">
                    <i class="fas fa-chart-area fa-7x"></i>
                  </div>
                  <div className="d-flex justify-content-center align-items-center circle my-3">
                    <i class="fas fa-vr-cardboard fa-7x" />
                  </div>
                  <div className="d-flex justify-content-center align-items-center circle my-3">
                  <i class="fas fa-bell fa-7x"></i>
                  </div>
                </div>
                <div className="row align-items-start justify-content-around mt-5 bg-success">
                  <p>this is brain</p>
                  <p>this is vr</p>
                </div>
              </div>
            </div>
            <div className="b">
              <button>sjdl</button>
            </div>
        </div>
        <style>{`
          img {
            opacity: 0.7;
            background-size: cover;
            display: block;
          }

          h1 {
            font-family: lato;
          }

          .intro {
            height: 500px;
            background: yellow;
          }

          i {
            color: #17a2bb;
            color: white
          }

          .circle {
            height: 200px;
            width: 200px;
            background: pink;
            border-radius: 100px;
            border: 1px solid white;
          }

        `}</style>
      </div>
    );
  }
}

export default index;
